import "./App.css";
import Header from "./components/Header";
import React, { useState } from "react";

function App() {
  const [url, setUrl] = useState("");

  function handleChange(event) {
    setUrl(event.target.value);
  }

  return (
    <div className="App">
      <Header />
      <form>
      <input
        type="text"
        placeholder="enter your url here"
        onChange={handleChange}
        value={url}
      />
      </form>
    </div>
  );
}

export default App;
